Sebagai seorang Kristen engkau harus hidup di tengah-tengah dunia yang tidak ber-Allah, maka percuma saja engkau berteriak, “Celakalah aku.” Yesus tidak berdoa supaya engkau di ambil keluar dari dunia, dan apa yang tidak Ia doakan, tidak perlu engkau dambakan. Jauh lebih baik untuk menghadapi kesulitan dalam kekuatan Tuhan, dan memuliakan Dia di dalamnya. Musuh senantiasa berjaga-jaga untuk menemukan ketidakkonsistenan dalam tingkah lakumu; maka itu jadilah sangat suci. Ingatlah bahwa semua mata melihat engkau, dan engkau diharapkan lebih daripada orang lain. Berusahalah untuk tidak memberi kesempatan bagi engkau untuk dipersalahkan. Biarlah kebaikanmu menjadi satu-satunya kesalahan yang dapat mereka temukan padamu. Seperti Daniel, pojokkanlah mereka untuk berkata mengenai engkau, “Kita tidak akan mendapat suatu alasan dakwaan terhadap Daniel ini, kecuali dalam hal ibadahnya kepada Allahnya!” [Daniel 6:5] Berusahalah untuk menjadi berguna dan juga konsisten. Mungkin engkau berpikir, “Jika aku berada dalam keadaan yang lebih menguntungkan, aku akan dapat melayani Tuhan, namun aku tidak dapat berbuat kebaikan apapun dalam keadaanku sekarang”; namun semakin buruk orang-orang yang di tengah-tengahnya engkau tinggal, mereka semakin perlu teguranmu; jika mereka bengkok, semakin perlu engkau menjadikan mereka lurus; dan jika mereka menjadi busuk, semakin perlulah engkau untuk memalingkan hati mereka yang angkuh kepada kebenaran. Di manakah seorang dokter harus berada selain di tempat yang banyak orang sakit? Di manakah kehormatan diraih seorang prajurit selain dalam api peperangan yang terpanas? Dan ketika lelahlah usaha dan dosa yang menemui engkau dalam segala kesempatan, ingatlah bahwa semua orang kudus telah menanggung ujian yang sama. Mereka saja tidak diangkut di atas ranjang bulu angsa menuju sorga, engkau tidak seharusnya berharap dapat bepergian dengan lebih mudah daripada mereka.
